import React from "react";

function Toolbar() {
  return (
    <div className="toolbar">
      <button>Bold</button>
      <button>Italic</button>
      <button>Color</button>
      <button>Add Row</button>
      <button>Add Column</button>
    </div>
  );
}

export default Toolbar;
